static String getGds(String data)
	{
		String type=data.toLowerCase();
		switch(type)
		{
		case "csbseg":
			return csBseg;
		
		case "reefer":
			return reefer;
			
		case "reefdang":
			return reefDang;
			
		case "csbb":
			return csbb;
		
		case "bb":
			return bb;
			
		case "general":
			return general;
			
		case "trans":
			return trans;	
		
		case "oog":
			return oog;
			
		case "dang":
			return dang;
			
		case "tpdoclevel":
			return tpDocLevel;
			
		case "csmulticargo":
			return csMultiCargo;
			
		case "multicargo":
			return multiCargo;
			
			
		case "aidcargo":
			return aidCargo;
			
		case "milcargo":
			return milCargo;
		
		case "gov":
			return gov;
		default:
			return removal;
		}
		
	}

public static String getPayload(String bol,String type,String param, String value)

{
	String gds=GetPayloadAvro.getGds(type);
	Helper.loginfo(bol, "BOL no");
	gds = gds.replaceAll(param, value);
	gds = gds.replaceAll("TPDOCNO", bol);
	gds = gds.replaceAll("OPRTR","SGL");
	gds = gds.replaceAll("SCAC_CODE","SEJJ");
	gds = gds.replaceAll("PKG_KND", "Carton");
	gds = gds.replaceAll("PKG_COUNT", "123");//this variable is only present in general bs
	gds = gds.replaceAll("VOLUME", "567");//this variable is only present in general bs
	gds = gds.replaceAll("MOD_OF_TRANS", "MVS");//this variable is only present in general bs
	gds = gds.replaceAll("BILL_TYPE", "negotiable");//this variable is only present in general bs and some of its valid values are "negotiable" and "sea waybill"
	gds = gds.replaceAll("HS_CODE", "110011");
	gds = gds.replaceAll("TEMP_C", "95");//for reefer,dangerous
	gds = gds.replaceAll("UN_NO", "1111");//for dangerous
	
	gds = gds.replaceAll("CONTAINER1", "CONT124");
	gds = gds.replaceAll("CON_SIZE", "20");
	gds = gds.replaceAll("CON_TYPE", "Dry");
	
	gds = gds.replaceAll("Gross_Wt_Kgs", "5231.000");
	gds = gds.replaceAll("Gross_Wt_Lbs", "11532.381");
	gds = gds.replaceAll("Tare_Wt_Kgs", "2420.000");
	gds = gds.replaceAll("Tare_Wt_Lbs", "5335.187");
	gds = gds.replaceAll("Cust_Wt_Kgs", "2811.000");
	gds = gds.replaceAll("Cust_Wt_Lbs", "6197.194");
	
	
	//for transhipment scenario
	gds = gds.replaceAll("TRANS_CITY", "RUBAI");
	gds = gds.replaceAll("TRANS_PORT", "RUBAIKA");
	gds = gds.replaceAll("V_CODE2","1ZM");
	gds = gds.replaceAll("V_VOYAGE2","115W");
	
	gds = gds.replaceAll("V_CODE","1ZM");
	gds = gds.replaceAll("V_VOYAGE","115W");
	gds = gds.replaceAll("LD_CITY", "DEBRV");
	gds = gds.replaceAll("LD_PORT", "DEBRVTM");
	gds = gds.replaceAll("DP_CITY", "DKAAR");
	gds = gds.replaceAll("DP_PORT", "DKAARPT");
	
	

	gds = gds.replaceAll("SEAL_NUMBER", "Seal444");
	gds = gds.replaceAll("MARKS_DESC_DOC", "Testmark1234");
	gds = gds.replaceAll("CARGO_DESC_DOC", "Testdemo");
		
	
	return gds;

} 
